import './App.css';
import Navbar from './components/Navbar'
import data from './data'

function App() {

  const card = data.map((item) =>
    console.log(item)
  )

  return (
    <div className="App">
       <Navbar/>
       <section className='card-list'>
        {card}
       </section>
    </div>
  );
}

export default App;
